import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-logout',
  templateUrl: './logout.component.html',
  styleUrls: ['./logout.component.scss']
})
export class LogoutComponent {


   constructor(private router:Router){

   }


   ngOnInit(){

   }
   login(){
    this.router.navigateByUrl('/login')
   }
}

<div class="container-fluid p-0">
    <div class="logindiv px-2">


        <div class="row ">
            <div class="col-sm-6 emptyleft">

            </div>
            <div class="col-sm-6 loginright">
                <div class="col-sm-12 col-lg-2 col-md-1"></div>
                <div class="col-sm-12 col-lg-8 col-md-10">

                    <div class="card text-center ">
                        <div class="text-center mb-3">
                            <img class="logo" src="assets\images\logo_sealed.png" alt="logo_sealed">
                        </div>
                        <div class="card-body logincard mt-5">

                            <h5 class="mt-3 ">Logged in as <b>admin@sealed.co.in</b></h5>

                            <button class="button logout_btn my-4" onclick="login()">Logout</button>
                        </div>
                    </div>
                </div>
                <div class="col-sm-12 col-lg-2 col-md-1"></div>
            </div>

        </div>
    </div>
